alterFaceImage = function(n)
	if info[n].img.id then
		tfm.exec.removeImage(info[n].img.id)
	end
	
	local character,target
	if info[n].db.luaCoderData or info[n].meme then -- has finished the event for at least 1 round ago or is using the Turing Mouse title
		info[n].img.character = 1			
		character = memeFaces[1]
			
		target = "$"
	end
	
	if character then
		if info[n].memeFace then
			info[n].memeFace = false
			tfm.exec.chatMessage(string.format("<R>• %s => %s",n,character[3]),n)
		end
		
		info[n].img.sprite = info[n].img.sprite or math.random(#character.left)
		
		local side = info[n].right and "right" or "left"
		info[n].img.id = tfm.exec.addImage(character[side][info[n].img.sprite] .. ".png",target .. n,character[1],character[2])
		
		if character.throw then
			info[n].img.throw = table.random(memeFaces[character.throw][side])
		end
	end
end

--[[ Collect decorations + playerData ]]--
eventPlayerDataLoading = function(n,tentative)
	if tentative < 4 then
		local loadingData = system.loadPlayerData(n)
		if loadingData then
			tfm.exec.chatMessage("<G>" .. system.community.dataTry,n)
		else
			eventPlayerDataLoading(n,tentative + 1)
		end
	else
		tfm.exec.killPlayer(n)
		tfm.exec.chatMessage("<G>" .. system.community.dataFail,n)
	end
end
eventPlayerDataLoaded = function(n,data)
	if data ~= "" and data:find(":luaCoderData") then
		info[n].db = serialization(data)
	else
		system.savePlayerData(n,serialization(info[n].db))
	end
	
	tfm.exec.chatMessage("<G>" .. system.community.dataSuccess,n)
	
	local descompiled = system.descompileFragments(n)
	system.missedFragments(n,descompiled)
	
	local done = system.verifyTrigger(n)
	if not done then
		local id = tfm.exec.addImage("15cec3c1d25.png","&0",145,70,n) -- Old: "15cd74e485e.png","&0",335,130,n
		system.newTimer(function()
			tfm.exec.removeImage(id)
		end,10000,false)
		
		tfm.exec.chatMessage("<CE>[•] ".. system.community.findFragments .. "\n↓ ↓ ↓ ↓ ↓ ↓",n)
		info[n].pieces = {(#descompiled - #info[n].missedFragments),#descompiled}
		tfm.exec.chatMessage("<CE>[•] ".. system.community.fragments .." : " .. info[n].pieces[1] .. "/" .. info[n].pieces[2],n)
		system.bindKeyboard(n,3,true,true)
	end
	
	for i = 0,2,2 do
		system.bindKeyboard(n,i,true,true)
	end
	system.bindKeyboard(n,32,true,true)
	
	info[n].dataLoaded = true
	
	alterFaceImage(n)
end

